import React from 'react';

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

const Home = () => {
  return (
    <Wrapper>
      <Title>
        Hello?
      </Title>
    </Wrapper>
  )
};

export default Home;
